import React from 'react'
import { Nav, NavItem, Button } from 'reactstrap'

import '../index.css'


function Navi(props){
const navStyle = {

    background:  'cadetblue',
    color: 'white'


};

    return(

        <div className="navi">
        <Nav style={navStyle}>

        <NavItem>Home</NavItem>
        <NavItem>Profile</NavItem>
        <NavItem>Projects</NavItem>
        <NavItem>Contact</NavItem>
        <NavItem>About</NavItem>


        </Nav>
        </div>

    );
}

export default Navi
